class Solution:
    def originalDigits1(self, s: str) -> str:
        from collections import Counter
        s = Counter(s)
        lookup = [
            "zero",
            "one",
            "two",
            "three",
            "four",
            "five",
            "six",
            "seven",
            "eight",
            "nine",
        ]
        lookup = [Counter(l) for l in lookup]
        self.res = ""

        def dfs(s, loc, tmp):
            # print(s)
            if not s:
                # print(s, tmp)
                self.res = tmp
                return
            for i in range(loc, 10):
                if self.res: return
                if not lookup[i] - s:
                    dfs(s - lookup[i], loc, tmp + str(i))

                # if self.res:
                #     return
                # for a in lookup[i]:
                #     if a not in s:
                #         dfs(s, loc + 1, tmp)
                #         break
                # else:
                #     for a in lookup[i]:
                #         s = s.replace(a, "", 1)
                #     dfs(s, i, tmp + str(i))
                #     for a in lookup[i]:
                #         s += a

        dfs(s, 0, "")
        return self.res

    def originalDigits(self, s: str) -> str:
        from collections import Counter
        s = Counter(s)
        #print(s)
        zero = s["z"]
        two = s["w"]
        four = s["u"]
        six = s["x"]
        eight = s["g"]
        one = s["o"] - zero - two - four
        three = s["t"] - eight - two
        five = s["f"] - four
        seven = s["s"] - six
        nine = s["i"] - six - eight - five
        #print(zero)
        res = ""
        for idx, val in enumerate([
            zero,
            one,
            two,
            three,
            four,
            five,
            six,
            seven,
            eight,
            nine,
        ]):
            res += str(idx) * val
        return res


